INSERT INTO `fingertips_blog` (`blog_id`, `blog_title`, `blog_category`, `blog_sub_title`, `blog_tags`, `blog_description`, `blog_image`, `blog_added_by`, `blog_added_on`, `blog_likes`, `blog_view`) VALUES
(47, 'Difference between  classification and regression', 'Data Science', 'Get to know the difference between Classification and Regression', 'classification,logistic-regression,support-vector-machines,svm,knn,naÃ¯ve-bayes-classifiers,regression,simple-linear-regression,polynomial-regression,regression-algorithms', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Classification and Regression happen to be two key problems in prediction that are handled by data mining and ML.</span></span></p>\r\n\r\n<h3 dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Classification </span></span></h3>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>It is the method by which a model or function is discovered that helps to segregate the data into various categorical groups, i.e. discrete values. In classification, the data is labeled according to certain input criteria under different labels and then the labels for the data are expected. Classification is a tool that can be used for categorizing a given set of data into groups on both structured and unstructured data. The method starts with the projection of the class of given data points. Classes are also regarded as targets, labels, or categories. Following are some of the classification algorithms:</span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><a href=\'https://fingertips.co.in/data-science-master-program\'>Check out the Data Science Masters Course @ FingerTips</a></span></span></p>\r\n\r\n<h3 dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Logistic Regression</span></span></h3>\r\n\r\n<p dir=\'ltr\'>&nbsp;</p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>The primary idea of logistic regression is to find relationships between features an the probability of particular outcome.</span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Decision Tree: Decision tree is a tree-structured classifier, where internal nodes represent the features of a dataset, branches represent the decision rules and every leaf node represent the outcome.</span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Support Vector Machines (SVM): The SVM algorithm&#39;s goal is to build the best line or decision boundary that can segregate n-dimensional space into groups such that in the future we can conveniently place the new data point in the right group.</span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>&nbsp;</span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>KNN: The KNN algorithm assumes that identical items exist in close proximity. In other words, similar things are close to each other. The principle of similarity (sometimes called distance, proximity, or closeness) is captured by KNN with some calculation, measuring the distance on a graph between points.</span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Na&iuml;ve Bayes Classifiers</span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Naive Bayes classifiers are a set of Bayes&#39; Theorem-based classification algorithms. It is not a single algorithm but a family of algorithms where a general concept is shared by all of them, i.e. each pair of features being classified is independent of each other.</span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>&nbsp;</span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Regression:</span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>For predicting a continuous value, regression models are used. One of the typical examples of regression is the estimation of house prices given house characteristics such as size, location, price, etc.&nbsp; Using training data, a single output value is generated in regression. This value is a probabilistic interpretation that is computed after taking into account the frequency of the correlation between the input variables. Following are some Regression Algorithms:</span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Simple Linear regression: One of the variables is predictor or independent variable and the other is response or dependent variable. It attempts to find statistical relationship but not deterministic relationship.</span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Multiple Linear Regression: In order to estimate the relationship between two or more independent variables and one dependent variable, multiple linear regression is used.</span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Polynomial Regression:&nbsp; Assuming we know that our data is correlated, but the relationship doesn&rsquo;t look linear? So depending on what the data looks like, we can do a polynomial regression on the data to fit a polynomial equation to it.</span></span></p>\r\n', 'Classification-vs-Regression.jpg', 'Fingertips Writing Team', '2021-07-09 06:37:55', 0, 149),
(51, 'Significance of Deep learning', 'Data Science', 'Deep learning is a set of groundbreaking new inventions, tools, algorithms, and extraordinarily diverse ways to do certain tasks. Compared to any machine, it is about machines being cognizant and taking on the roles traditionally reserved exclusively for humans because of their far superior intelligence capabilities.', 'deep-learning,artificial-neural-networks,biological-nervous-system,applications-and-implementations-of-deep-learning,self-driving-cars,image-recognition,advertising,automatic-colorization,handwriting-generation', '<p><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Deep learning is a set of groundbreaking new inventions, tools, algorithms, and extraordinarily diverse ways to do certain tasks. Compared to any machine, it is about machines being cognizant and taking on the roles traditionally reserved exclusively for humans because of their far superior intelligence capabilities. The fundamental idea of deep learning and Artificial neural networks is derived from the structure of a biological nervous system.</strong></span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong><a href=\'https://fingertips.co.in/data-science-master-program\'>Check out the Data Science Masters Program @ Fingertips</a></strong></span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>In the last few decades, deep learning has made some significant strides in various fields and domain. In this post we&rsquo;d acquaint ourselves with some of the most useful applications and implementations of deep learning.</strong></span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>1) &nbsp; Self Driving Cars: Companies developing such driver assistance programs, as well as full-blown self-driving vehicles such as Google&#39;s, need to train a machine how to take over key bits (or all) of driving instead of the senses of a person using artificial sensor systems. To do that, businesses normally start with training algorithms that use a large volume of data.</strong></span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>2) &nbsp; Image Recognition: Image recognition is another common field of deep learning. It attempts to recognise and classify contents in photographs like people and objects as well as to explain the content and context. In many industries, such as gaming, social media, retail, tourism, etc., image recognition is still being used.</strong></span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>3) &nbsp; Advertising: Another primary area which has been changed by deep learning is advertisement. Both publishers and marketers have used it to increase the relevance of their commercials and raise their promotional strategies&#39; return on investment.</strong></span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>4) &nbsp; Automatic Colorization: The task of applying color to pictures is image colorization. Deep learning can be used to color a picture using the objects and their background within the photograph, just as the problem might be approached by a human operator. This power optimizes ImageNet-trained and co-opted high-quality and very large fully convolutional neural networks for&nbsp; image colorization.</strong></span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>5) &nbsp; Handwriting Generation: This is a process where, given a corpus of handwriting samples, new handwriting for a given word or phrase are generated.</strong></span></span></p>\r\n\r\n<p dir=\'ltr\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>&nbsp;The handwriting is given after the handwriting samples have been produced as a series of coordinates used by a pen. The relationship between the pen movement and the letters is learned from this corpus, and fresh examples can be produced ad hoc.</strong></span></span></p>\r\n', 'glowing-technology-blue-face-artificial-intelligence_1017-21771.jpg', 'Fingertips Writing Team', '2021-07-09 07:05:28', 0, 153),
(54, 'Delving deep into the difference between Artificial Intelligence, Machine Learning & Data Science', 'Data Science', 'Irrespective of oneâ€™s professional vocation or educational background AI, ML, Data Science and Data Analytics are terms we are all privy to. However, due to their sophisticated interrelation with one another these terms are used interchangeably. Which is unreasonable, in this post we would be going into details about how these terms are different yet interlinked to each other. But first letâ€™s have an understanding of what these words stand for individually.', 'data-science,machine-learning,artificial-intelligence', '<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Irrespective of one&rsquo;s professional vocation or educational background AI, ML, Data Science and Data Analytics are terms we are all privy to. However, due to their sophisticated interrelation with one another these terms are used interchangeably. Which is unreasonable, in this post we would be going into details about how these terms are different yet interlinked to each other. But first let&rsquo;s have an understanding of what these words stand for individually.</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Data Science :</strong></span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>The primary objective of data science is getting new results from data. In practical terms, everything connected with data selection, preparation and analysis pertains to data science.<br />\r\nData science enables us to extrapolate relevant information from huge bulks of data. Almost every organization generates tons of data through various operations and reports. Data science uses that data that would have otherwise gone to waste and exploits it in order to generate information to make useful decisions and accurate predictions. </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>According to a report by &lsquo;The Economist&rsquo; in 2017 data surpassed oil in value; data is now the most valuable asset on the planet. We&rsquo;re all aware that every tech company is collecting immense amounts of data. Because the more data you have at your disposal, the more business insights you can produce. With the help of data science you can unravel patterns in data that you didn&rsquo;t even know existed. Due to such vast potential data science has become one of the fastest growing stream in the tech world. </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Usage of data Science </strong></span></span></p>\r\n\r\n<ol>\r\n	<li><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Predictive analytics (prediction of events)</span></span></li>\r\n	<li><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Recommendation systems (like aforementioned companies)</span></span></li>\r\n	<li><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Social research </span></span></li>\r\n	<li><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Tactical Optimization </span></span></li>\r\n</ol>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Popular companies&nbsp; that use Data Science:</strong></span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong><img alt=\'\' src=\'https://fingertips.co.in/assets/blogimg/1626074809187BLOG 1 (A).jpg.jpg\' style=\'width:505px\' /></strong></span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Artificial Intelligence:</strong></span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>&nbsp;What precisely is AI? AI is explained as any task performed by a program or a machine that, if a human performed the same task, we would say the human would&nbsp; have to apply intelligence. </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Artificial intelligence is basically the potential of machines to comprehend data, learn from data, identify relevant patterns hidden in the data, to make inference from the data, and eventually make decisions based on the knowledge. Now this may sound surprisingly similar to the process to human learning. But if you take into consideration the immense computational power of our computers, it gives them the ability to process and learn from huge bulks of data which humans can&rsquo;t. which brings us to our next point , you need to make sure that you have adequate data for the AI to learn from. If you use&nbsp; small data lake in order to train your model, the accuracy of your model would be extremely low. So the larger data lake you have, better is the training of your model, and more accurate would be your result. With respect to the type and size of your data you can use various algorithms. And this is where Deep learning and Machine learning turn up. </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Applications of AI &ndash;</strong></span></span></p>\r\n\r\n<ol>\r\n	<li><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Cognitive Robotics (e.g- the robot Sophia)</span></span></li>\r\n	<li><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Game playing (e.g- Alpha go)</span></span></li>\r\n	<li><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Natural language processing </span></span></li>\r\n	<li><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Optimization etc. </span></span></li>\r\n</ol>\r\n\r\n<p><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><img alt=\'\' src=\'https://fingertips.co.in/assets/blogimg/1626074707492BLOG 1 (b).jpg\' style=\'height:349px; width:619px\' /></span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Machine Learning:</strong></span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Machine learning is basically a subset of AI. In fact machine learning can also be considered as an implementation of&nbsp; AI. As the name suggests machine learning is used in operations where a machine needs to learn from immense bulks of data that we have available to us.&nbsp; But the question is how does a machine learn?</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Contrary to writing explicit codes, you feed in data to an inclusive algorithm and it draws logic based on that data. There are various ways to make a machine learn. The said machine learning methods are called Supervised learning, Unsupervised learning, and Reinforcement learning. In these methods a machine is told what the traits of independent variables are and what the dependent variables are so that the machine discovers the association among the dependent and non dependent variables in the data.</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>How Companies are using machine learning-</strong></span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Huge companies like Netflix, YouTube and Amazon utilize predictive analytics to improve their recommendations to the users. That&rsquo;s how the platform&nbsp; keeps the users&nbsp; involved and active for longer durations. All suggestions presented to the user are utilizing machine learning algorithms in order to understand the user&rsquo;s preferences. For instance- what kind of shows they like. </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong><img alt=\'\' src=\'https://fingertips.co.in/assets/blogimg/1626074643265BLOG 1 (C).jpg\' style=\'height:390px; width:624px\' /></strong></span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Professionals who work with ML are proficient at &ndash;</strong></span></span></p>\r\n\r\n<ol>\r\n	<li><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Experience with python, R</span></span></li>\r\n	<li><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Experience with Opencv</span></span></li>\r\n	<li><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Experience with ML algorithms </span></span></li>\r\n	<li><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Hands-on experience with scikit-learn, scipy,NetworkX, Spacy, NLTK, etc.</span></span></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n', 'DS-AI-ML-1.jpg', 'Fingertips Writing Team', '2021-07-12 07:28:00', 0, 201),
(55, ' Exploring the fine line between Data Science & Data Analytics', 'Data Science', ' Data is being generated all over the world at an ever increasing rate. In last two years alone, the astounding 90% of worldâ€™s data has been generated, and it is continuing to do so as we speak. But a substantial proportion of that data remains raw and unprocessed. Due to this reason there is a significant requirement in the field of data science and data analytics. However, very often these terms are perceived interchangeably. In this post I will elucidate the rudimentary differences between these different and yet interrelated terms. ', 'data-science,data-analytics,machine-learning,deep-learning,artificial-intelligence', '<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>&nbsp;Data is being generated all over the world at an ever increasing rate. In last two years alone, the astounding 90% of world&rsquo;s data has been generated, and it is continuing to do so as we speak. But a substantial proportion of that data remains raw and unprocessed. Due to this reason there is a significant requirement in the field of data science and data analytics. However, very often these terms are perceived interchangeably. In this post I will elucidate the rudimentary differences between these different and yet interrelated terms. </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Data Science</strong></span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Data science exploits Artificial Intelligence to make sense from historical data and detect patterns in the data. The role of a data scientist involves additional responsibilities, such as- decide which ML algorithm to use based on the statistical analysis, deployment of the model and even optimization of the model, and this is where data science differs from data analytics. Data science is a stream that requires multidisciplinary expertise in various domains such as knowledge of statistics, mathematics, business and most importantly programming skills in order to extrapolate relevant information from data.&nbsp; This field primarily focuses on unraveling answers to unknown questions Data science can also be interpreted as more of a tech field of data management. A data scientist basically assesses the unknown by asking questions, creating algorithms, building statistical models, and deploying models. A data scientist can be assumed to be qualified enough to carry out tasks of a data analyst (for instance- statistical analysis, visualization etc). </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Tools used by data Scientists: </strong></span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Python, R</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Tableau</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>NLTK</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Matplotlib</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Scikit-learn</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>&nbsp;Tensorflow</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Data analytics </strong></span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Data analytics is a sub-part of data science. It basically aims to utilize data in order to gain meaningful insights from data sets. Data analytics can also be interpreted as the exploration of data. It involves analysis of available data sets using various tools. The primary duties of a data analyst involve statistical analysis of data and Visualization. Some of the widely used data analytics tools for visualization of data are- Tableau, Power BI etc. &nbsp;Data analytics is essentially based on generating results that can immediately lead to improvements. </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Data analytics also involves a variety of different branches of wider statistics and analysis of data that help to integrate various data sources and find connections while simplifying the outcomes.</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Regardless of their variations, both data science and data analytics are essential components of the future of data. Both of these technologies are being embraced by companies that aim to incorporate technological change which would help them to gain a better understanding of how their organizations run. </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></span></span></p>\r\n\r\n<table border=\'1\' cellspacing=\'0\' class=\'MsoTableGrid\' style=\'border-collapse:collapse; border:solid black 1.0pt\'>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\'border-color:black; border-style:solid; border-width:1.0pt; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n			</td>\r\n			<td style=\'border-color:black; border-left:none; border-style:solid; border-width:1.0pt; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0; text-align:center\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Data Science </strong></span></span></p>\r\n			</td>\r\n			<td style=\'border-color:black; border-left:none; border-style:solid; border-width:1.0pt; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>&nbsp;&nbsp;&nbsp;&nbsp; Data Analytics</strong></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\'border-color:black; border-style:solid; border-top:none; border-width:1.0pt; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Approach </strong></span></span></p>\r\n			</td>\r\n			<td style=\'border-bottom:solid black 1.0pt; border-left:none; border-right:solid black 1.0pt; border-top:none; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Broad approach</span></span></p>\r\n			</td>\r\n			<td style=\'border-bottom:solid black 1.0pt; border-left:none; border-right:solid black 1.0pt; border-top:none; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0; text-align:center\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Focused approach</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\'border-color:black; border-style:solid; border-top:none; border-width:1.0pt; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Scope </strong></span></span></p>\r\n			</td>\r\n			<td style=\'border-bottom:solid black 1.0pt; border-left:none; border-right:solid black 1.0pt; border-top:none; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0; text-align:center\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Macro </span></span></p>\r\n			</td>\r\n			<td style=\'border-bottom:solid black 1.0pt; border-left:none; border-right:solid black 1.0pt; border-top:none; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Micro </span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\'border-color:black; border-style:solid; border-top:none; border-width:1.0pt; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Aim </strong></span></span></p>\r\n			</td>\r\n			<td style=\'border-bottom:solid black 1.0pt; border-left:none; border-right:solid black 1.0pt; border-top:none; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Aims to ask questions</span></span></p>\r\n			</td>\r\n			<td style=\'border-bottom:solid black 1.0pt; border-left:none; border-right:solid black 1.0pt; border-top:none; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Aims to find actionable data </span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\'border-color:black; border-style:solid; border-top:none; border-width:1.0pt; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Use of big data</strong></span></span></p>\r\n			</td>\r\n			<td style=\'border-bottom:solid black 1.0pt; border-left:none; border-right:solid black 1.0pt; border-top:none; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Yes </span></span></p>\r\n			</td>\r\n			<td style=\'border-bottom:solid black 1.0pt; border-left:none; border-right:solid black 1.0pt; border-top:none; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Yes </span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\'border-color:black; border-style:solid; border-top:none; border-width:1.0pt; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n			</td>\r\n			<td style=\'border-bottom:solid black 1.0pt; border-left:none; border-right:solid black 1.0pt; border-top:none; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Uses a multi-layered approach to provide data</span></span></p>\r\n			</td>\r\n			<td style=\'border-bottom:solid black 1.0pt; border-left:none; border-right:solid black 1.0pt; border-top:none; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Collects, cleanses, and communicates data</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\'border-color:black; border-style:solid; border-top:none; border-width:1.0pt; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Major Fields</strong></span></span></p>\r\n			</td>\r\n			<td style=\'border-bottom:solid black 1.0pt; border-left:none; border-right:solid black 1.0pt; border-top:none; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Machine learning, AI, search&nbsp; engine engineering, corporate analytics </span></span></p>\r\n			</td>\r\n			<td style=\'border-bottom:solid black 1.0pt; border-left:none; border-right:solid black 1.0pt; border-top:none; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Healthcare, gaming, travel, industries with immediate data needs.</span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 'Blog 2.jpg', 'Fingertips Writing Team', '2021-07-12 08:07:13', 0, 133),
(56, 'The flood of Data Scientists and the rise of Data Science', 'Data Science', 'Data is being generated all over the world at an ever increasing rate. In last two years alone, the astounding 90% of worldâ€™s data has been generated, and it is continuing to do so as we speak. But a substantial proportion of that data remains raw and unprocessed. ', 'data-analytics,data-science,data-science-masters-program,tools,data-scientists', '<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Data is being generated all over the world at an ever-increasing rate. In last two years alone, the astounding 90% of world&rsquo;s data has been generated, and it is continuing to do so as we speak. But a substantial proportion of that data remains raw and unprocessed. Due to this reason, there is a significant requirement in the field of data science and data analytics. However, very often these terms are perceived interchangeably. In this post I will elucidate the rudimentary differences between these different and yet interrelated terms. </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><a href=\'https://fingertips.co.in/data-science-master-program\' style=\'color:blue; text-decoration:underline\'>Check out the Data Science Masters Programme @ Fingertips</a></span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Data Science</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Data science exploits Artificial Intelligence to make sense from historical data and detect patterns in the data. The role of a data scientist involves additional responsibilities, such as- decide which ML algorithm to use based on the statistical analysis, deployment of the model and even optimization of the model, and this is where data science differs from data analytics. Data science is a stream that requires multidisciplinary expertise in various domains such as knowledge of statistics, mathematics, business and most importantly programming skills in order to extrapolate relevant information from data.&nbsp; This field primarily focuses on unraveling answers to unknown questions Data science can also be interpreted as more of a tech field of data management. A data scientist basically assesses the unknown by asking questions, creating algorithms, building statistical models, and deploying models. A data scientist can be assumed to be qualified enough to carry out tasks of a data analyst (for instance- statistical analysis, visualization etc). </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Tools used by Data Scientists: </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Python, R</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Tableau</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>NLTK</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Matplotlib</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Scikit-learn</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>&nbsp;Tensorflow</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Data analytics </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Data analytics is a sub-part of data science. It basically aims to utilize data in order to gain meaningful insights from data sets. Data analytics can also be interpreted as the exploration of data. It involves analysis of available data sets using various tools. The primary duties of a data analyst involve statistical analysis of data and Visualization. Some of the widely used data analytics tools for visualization of data are- Tableau, Power BI etc. &nbsp;Data analytics is essentially based on generating results that can immediately lead to improvements. </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Data analytics also involves a variety of different branches of wider statistics and analysis of data that help to integrate various data sources and find connections while simplifying the outcomes.</span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'>Regardless of their variations, both data science and data analytics are essential components of the future of data. Both of these technologies are being embraced by companies that aim to incorporate technological change which would help them to gain a better understanding of how their organizations run. </span></span></p>\r\n\r\n<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></span></span></p>\r\n\r\n<table border=\'1\' cellspacing=\'0\' class=\'MsoTableGrid\' style=\'border-collapse:collapse; border:solid black 1.0pt\'>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\'border-color:black; border-style:solid; border-width:1.0pt; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'>&nbsp;</p>\r\n			</td>\r\n			<td style=\'border-color:black; border-left:none; border-style:solid; border-width:1.0pt; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0; text-align:center\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Data Science </strong></span></span></p>\r\n			</td>\r\n			<td style=\'border-color:black; border-left:none; border-style:solid; border-width:1.0pt; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>&nbsp;&nbsp;&nbsp;&nbsp; Data Analytics</strong></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\'border-color:black; border-style:solid; border-top:none; border-width:1.0pt; vertical-align:top; width:159.6pt\'>\r\n			<p style=\'margin-left:0; margin-right:0\'><span style=\'font-size:22px\'><span style=\'font-family:robotoregular\'><strong>Approach </strong></span></span></p>\r\n			</td>\r\n			<td style=\'border-bottom:solid 