(299, 29, 'Delete from the table all employees in the IT department (code 14).<br />\r\n', 1, 'delete from Employee where Department=14;', 'delete from Employee where Department(14);', 'delete from Employee on Department=14;', 'delete Employee where Department=14;', 'a', '', '', 1, '', 1, 1610346984),
(300, 29, 'Delete from the table all employees who work in departments with a budget greater than or equal to $60,000.<br />\r\n', 1, 'delete employee from employee with  department on employee.Department=department.Code where department.budget &gt;= 60000;', 'delete employee from employee join department on employee.Department=department.Code where department.budget &gt;= 60000;', 'delete employee from employee join department on employee.Department=department.Code on department.budget &gt;= 60000;', 'delete employee from employee join department on employee.Department=department.Code where department.budget = 60000;', 'b', '', '', 1, '', 1, 1610346984),
(301, 30, 'List the last name, first name and employee number of all programmers who were hiredon or before 21 May 1991 sorted in ascending order of last name<br />\r\n', 1, 'select first_name, last_name, employee_no from Employee where hire_date &lt;= &#039;1991-5-21&#039; order by last_name;', 'select first_name, last_name, employee_no from Employee where hire_date = &#039;1991-5-21&#039; order by last_name;', 'select first_name, last_name, employee_no from Employee where hire_date &lt;= 1991-5-21 order by last_name;', 'select first_name, last_name, employee_no from Employee where hire_date &lt;= &#039;1991-5-21&#039;;', 'a', '', '', 1, '', 1, 1610348175),
(302, 30, 'List the department number, last name and salary of all employees who were hiredbetween 16/09/87 and 12/05/96 sorted in ascending order of last name withindepartment number.<br />\r\n', 1, 'select department_no, last_name, annual_salary from Employee where hire_date in &#039;1987-09-16&#039; and &#039;1996-05-12&#039; order by department_no, last_name asc;', 'select department_no, last_name, annual_salary from Employee where hire_date between &#039;1987-09-16&#039; and &#039;1996-05-12&#039; order by department_no, last_name asc;', 'select department_no, last_name, annual_salary from Employee where hire_date is &#039;1987-09-16&#039; and &#039;1996-05-12&#039; order by department_no, last_name asc;', 'select department_no, last_name, annual_salary from Employee where hire_date between &#039;1987-09-16&#039;, &#039;1996-05-12&#039; order by department_no, last_name asc;', 'b', '', '', 1, '', 1, 1610348175),
(303, 30, 'List all the data for each job where the annual salary is greater than 15000 sorted indescending order of the annual salary.<br />\r\n', 1, 'select * from Employee where annual_salary &gt; 15000 order annual_salary desc;', 'select * from Employee where annual_salary &gt; 15000 order by annual_salary;', 'select * from Employee where annual_salary(15000) order by annual_salary desc;', 'select * from Employee where annual_salary &gt; 15000 order by annual_salary desc;', 'd', '', '', 1, '', 1, 1610348175),
(304, 30, 'List the last name, first name, job id and commission of employees who earncommission sorted in ascending order of first name.(Commision=Annual_Salary*Commission_Percent)<br />\r\n', 1, '&quot;select last_name, first_name, job_id, annual_salary*commission_percent as commission from Employee having commission &gt; 0 order by first_name; &quot;', '&quot;select last_name, first_name, job_id, annual_salary*commission_percent as commission from Employee having commission &gt; 0 order by first_name desc; &quot;', '&quot;select last_name, first_name, job_id, annual_salary*commission_percent as commission from Employee having commission &gt; 0 order first_name; &quot;', '&quot;select last_name, first_name, job_id, annual_salary+commission_percent as commission from Employee having commission &gt; 0 order by first_name; &quot;', 'a', '', '', 1, '', 1, 1610348175),
(305, 30, 'Which Job Title are found in the IT and Sales departments?<br />\r\n', 1, 'select distinct job_title,department_name from Employee where department_name in (IT,Sales);', 'select distinct job_title,department_name from Employee where department_name in (&#039;IT&#039;,&#039;Sales&#039;);', 'select distinct job_title,department_name from Employee where department_name in (IT,Sales);', '&quot;select distinct job_title,department_name from Employee where department_name are (&#039;IT&#039;,&#039;Sales&#039;); &quot;', 'b', '', '', 1, '', 1, 1610348175),
(306, 30, 'List the last name of all employees in departmentno 10 and 40 together with theirmonthly salaries (rounded to 2 decimal places), sorted in ascending order of last name.<br />\r\n', 1, 'select last_name, round(annual_salary/12,2) as monthly_salary from Employee where department_no in (â€˜10â€™,40) order by last_name asc;', 'select last_name, round(annual_salary/12) as monthly_salary from Employee where department_no in (10,40) order by last_name asc;', 'select last_name, round(annual_salary/12,2) as monthly_salary from Employee where department_no in (10,40) order by last_name asc;', 'select last_name, round(annual_salary*12,2) as monthly_salary from Employee where department_no in (10,40) order by last_name asc;', 'c', '', '', 1, '', 1, 1610348175),
(307, 30, 'Show the Annual Salary salaries displayed with no decimal places.<br />\r\n', 1, 'select round(annual_salary) as absoluteSalary from Employee; ', 'select round=â€annual_salaryâ€ as absoluteSalary from Employee;', 'select round(â€œannual_salaryâ€) as absoluteSalary from Employee;', 'select whole(annual_salary) as absoluteSalary from Employee;', 'a', '', '', 1, '', 1, 1610348175),
(308, 30, 'Show the total number of employees.<br />\r\n', 1, 'select count(distinct=employee_no) as total_no_of_employees from Employee;', 'select (distinct employee_no) as total_no_of_employees from Employee;', 'select count(employee_no) as total_no_of_employees from Employee;', 'select count(distinct employee_no) as total_no_of_employees from Employee;', 'd', '', '', 1, '', 1, 1610348175),
(309, 30, 'List the department number, department name and the number of employees for eachdepartment that has more than 2 employees grouping by department number anddepartment name.<br />\r\n', 1, '&quot;select department_no, department_name, count(distinct employee_no) as no_of_employees from Employee group by department_no, department_name having no_of_employees &gt; 2; &quot;', '&quot;select department_no, department_name, count(employee_no) as no_of_employees from Employee group by department_no, department_name having no_of_employees &gt; 2; &quot;', '&quot;select department_no, department_name, count(distinct employee_no) as no_of_employees from Employee group department_no, department_name having no_of_employees &gt; 2; &quot;', '&quot;select department_no, department_name, count(distinct employee_no) as no_of_employees from Employee group by department_no, department_name having no_of_employees(2); &quot;', 'a', '', '', 1, '', 1, 1610348175),
(310, 30, 'List the department number, department name and the number of employees for thedepartment that has the highest number of employees using appropriate grouping.<br />\r\n', 1, '&quot;select department_no, department_name, count(distinct employee_no) as no_of_employees from Employee group by department_name having no_of_employees = (select count(*) from Employee group by department_no order by count(*) desc limit ); &quot;', '&quot;select department_no, department_name, count(distinct employee_no) as no_of_employees from Employee group by department_name having no_of_employees = (select count(*) from Employee group by department_no order by count(*) desc limit 1); &quot;', '&quot;select department_no, department_name, count(distinct employee_no) as no_of_employees from Employee group by department_name having no_of_employees = (select count(*) from Employee group by department_no order by count() desc limit 1); &quot;', '&quot;select department_no, department_name, count(distinct employee_no) as no_of_employees from Employee group by department_name having no_of_employees = (select count() from Employee group by department_no order by count() desc limit 1); &quot;', 'b', '', '', 1, '', 1, 1610348175),
(311, 30, 'List the department number and name for all departments where no programmers work.<br />\r\n', 1, 'select distinct department_no, department_name from Employee where job_title not &#039;Programmer&#039;;', 'select distinct department_no, department_name from Employee where job_title /= &#039;Programmer&#039;;', 'select distinct department_no, department_name from Employee where job_title != &#039;Programmer&#039;;', 'select distinct department_no, department_name from Employee where job_title = &#039;Programmer&#039;;', 'c', '', '', 1, '', 1, 1610348175),
(312, 30, 'Update all the Annual salaries for jobs with an increase of 1000.(apply on creating Employeecopy table from Employee table)<br />\r\n', 1, 'update Employeecopy set annual_salary = annual_salary + 1000;', 'update Employeecopy annual_salary = annual_salary + 1000;', 'update Employeecopy set annual_salary = annual_salary,1000;', 'update Employeecopy set annual_salary != annual_salary + 1000;', 'a', '', '', 1, '', 1, 1610348175),
