(314, 30, 'The job history for employee number 102 is no longer required. Delete this record.(from Employeecopy)<br />\r\n', 1, ' delete from Employeecopy where employee_no &#039;102&#039;;', 'delete from Employeecopy where employee_no = &#039;102&#039;;', 'delete from Employeecopy where employee_no != &#039;102&#039;;', 'delete from Employeecopy where employee_no = (&#039;102)&#039;;', 'b', '', '', 1, '', 1, 1610348175),
(315, 30, 'Prepare a table with percentage raises, employee numbers and old andnew salaries. Employees in departments 20 and 10 are given a 5% rise, employees indepartments 50, 90 and 30 are given a 10% rise and employees in otherdepartments are not given a rise.<br />\r\n', 1, 'create view personal_table as select employee_no, IF(department_no in (20,10),5,If(department_no in (50,90,30),10,0)) percentage_raise, annual_salary old_annual_salary, round(annual_salary*(1+(IF(department_no in (20,10),5,If(department_no in (50,90,30),10,0))*0.01)),2) new_annual_salary from Employeecopy2;', 'create  personal_table as select employee_no, IF(department_no in (20,10),5,If(department_no in (50,90,30),10,0)) percentage_raise, annual_salary old_annual_salary, round(annual_salary*(1+(IF(department_no in (20,10),5,If(department_no in (50,90,30),10,0))*0.01)),2) new_annual_salary from Employeecopy2;', 'create view personal_table as select employee_no, IF(department_no in (20,10),5,If(department_no  (50,90,30),10,0)) percentage_raise, annual_salary old_annual_salary, round(annual_salary*(1+(IF(department_no  (20,10),5,If(department_no in (50,90,30),10,0))*0.01)),2) new_annual_salary from Employeecopy2;', 'create view personal_table as select employee_no,(department_no in (20,10),5,If(department_no in (50,90,30),10,0)) percentage_raise, annual_salary old_annual_salary, (annual_salary*(1+(IF(department_no in (20,10),5,If(department_no in (50,90,30),10,0))*0.01)),2) new_annual_salary from Employeecopy2;', 'a', '', '', 1, '', 1, 1610348175),
(316, 30, '&quot;Create a new view for managerâ€™s details only using all the fields from the employee<br />\r\ntable. &quot;<br />\r\n', 1, 'create view manager_table as select * from Employee where job_title like &#039;Manager&#039;;', 'create view manager_table as select * from Employee where job_title as Manager%;', 'create view manager_table as select * from Employee where job_title like &#039;Manager%&#039;;', 'create view manager_table as select * from Employee where job_title as &#039;Manager%&#039;;', 'c', '', '', 1, '', 1, 1610348175);
