(22, 65, 'How-to-write-an-effective-Data-science-resume', 'https://fingertips.co.in/blogs/how-to-write-an-effective-data-science-resume', 'How to write an effective Data science resume', 'What is a Data Science Resume? Understanding what makes up data science resume, and its elements, is difficult.'),
(23, 64, 'how-can-a-fresher-gain-some-real-life-experience-in-data-science-and-machine-learning-', 'https://fingertips.co.in/blogs/how-can-a-fresher-gain-some-real-life-experience-in-data-science-and-machine-learning?-', 'How can a fresher gain some real life experience in data science and machine learning?', 'If you are a fresher who is interested in getting some real life experience in data science, machine learning or its applications, you are at the right place.'),
(24, 63, 'what-questions-will-you-get-in-a-data-science-and-machine-learning-job-interviews--', 'https://fingertips.co.in/blogs/what-questions-will-you-get-in-a-data-science-and-machine-learning-job-interviews?', 'What questions will you get in a Data Science and Machine Learning job interviews?', 'The questions in a Data Science and Machine Learning job interviews have been extracted from real Data Science and Machine Learning job interview, by our team.'),
(25, 62, 'LOOKING-TO-SPECIALIZE-IN-ARTIFICIAL-INTELLIGENCE', 'https://fingertips.co.in/blogs/looking-to-specialize-in-artificial-intelligence?-here%e2%80%99s-your-guide-how-you-can-pursue-ai-for-your-post-graduation.-', 'Looking to specialize in Artificial Intelligence? Hereâ€™s your guide how you can pursue AI for your Post Graduation.', 'Fingertips has been chosen as one of the best courses to pursue in AI. This blog provides all the information you need to know about AI.'),
(26, 61, 'Spiking-Neural-Networks-vs-Artificial-Neural-Networks', 'https://fingertips.co.in/blogs/spiking-neural-networks-vs-artificial-neural-networks', 'Spiking Neural Networks vs Artificial Neural Networks', 'This article will compare two popular neural network architectures named spiking neural networks and artificial neural networks.'),
(27, 60, 'Here%E2%80%99s-why-you-should-choose-a-career-in-Data-Science', 'https://fingertips.co.in/blogs/here%e2%80%99s-why-you-should-choose-a-career-in-data-science', 'Hereâ€™s why you should choose a career in Data Science', 'Data Science is an emerging field. If you want a career where you have little or no competition and there is always room for you to grow, then data science might be the right choice for you'),
(28, 59, 'Learning-the-application-of-Artificial-Neural-Networks', 'https://fingertips.co.in/blogs/learning-the-application-of-artificial-neural-networks', 'Learning the application of Artificial Neural Networks', 'Introduction to data science and how to use artificial neural networks in the applications of big data and business intelligence.'),
(29, 58, 'A-guide-to-making-a-career-in-Data-science', 'https://fingertips.co.in/blogs/a-guide-to-making-a-career-in-data-science', 'A guide to making a career in Data science', 'Learn how to make a career in Data science, find the right jobs and get all the insights you need to advance your data science career.'),
(30, 57, 'Hovering-into-the-differences-between-Data-Science-Machine-Learning-and-Artificial-Intelligence', 'https://fingertips.co.in/blogs/hovering-into-the-differences-between-data-science,-machine-learning-and-artificial-intelligence', 'Hovering into the differences between Data Science, Machine Learning and Artificial Intelligence', 'Data Science, Machine Learning and Artificial Intelligence are terms that are used interchangeably, but what is the difference between them?'),
(31, 56, 'The-flood-of-Data-Scientists-and-the-rise-of-Data-Science', 'https://fingertips.co.in/blogs/the-flood-of-data-scientists-and-the-rise-of-data-science', 'The flood of Data Scientists and the rise of Data Science', 'The flood of Data Scientists and the rise of Data Science is changing the way companies strategize.'),
(32, 55, '-Exploring-the-fine-line-between-Data-Science-&-Data-Analytics', 'https://fingertips.co.in/blogs/-exploring-the-fine-line-between-data-science-&-data-analytics', 'Exploring the fine line between Data Science & Data Analytics', 'Do you know the difference between Data Science and Data Analytics? If not, read on to learn about the differences and why data science professionals battle for job titles!'),
(33, 54, 'Delving-deep-into-the-difference-between-Artificial-Intelligence-Machine-Learning-&-Data-Science', 'https://fingertips.co.in/blogs/delving-deep-into-the-difference-between-artificial-intelligence,-machine-learning-&-data-science', 'Delving deep into the difference between Artificial Intelligence, Machine Learning & Data Science', 'This article aims to elaborate on the difference between Artificial Intelligence, Machine Learning and Data Science.'),
(34, 51, 'Significance-of-Deep-learning', 'https://fingertips.co.in/blogs/significance-of-deep-learning', 'Significance of Deep learning', 'Deep learning is an area of machine learning based on a set of algorithms that attempt to model high-level abstractions in data by using models with a number of layers, composed of multiple nonlinear transformations.'),
(35, 47, 'Difference-between--classification-and-regression', 'https://fingertips.co.in/blogs/difference-between--classification-and-regression', 'Difference between classification and regression', 'You need to be able to identify the difference between classification and regression analysis, as both are important in data science.'),
(38, 93, 'The-Ultimate-Guide-To-SEO-and-Content-Marketing', 'https://fingertips.co.in/blogs/the-ultimate-guide-to-seo-and-content-marketing', 'The Ultimate Guide To SEO and Content Marketing', 'The Ultimate Guide To SEO and Content Marketing takes you on a journey to help you grow your digital marketing skills and make more money through the power of search engine optimization (SEO) and content marketing.'),
(39, 94, 'Important-Hacks-Of-Instagram-Digital-Marketing-', 'https://fingertips.co.in/blogs/important-hacks-of-instagram-digital-marketing-', 'Important-Hacks-Of-Instagram-Digital-Marketing-', 'The important hacks of Instagram digital marketing are discussed here in this article. Boost your business and make more money by doing it through Instagram.'),
